/**
 * Returns the figure that contains the given point.
 * In contrast to containsPoint it returns its
 * innermost figure that contains the point.
 *
 * @see #containsPoint
 */
public Figure findFigureInside(int x, int y) {
    if (containsPoint(x, y))
        return this;
    return null;
}
